import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';

class App extends Component {
  render(){

    return(
      <div class="col">
        <div class="row1">
          <Strbox/>
        </div>
        <div class="row2">
          <Opbutton/>
        </div>
      </div>
    );
  }
}
class Strbox extends Component{
  render(){
    return(
      <div>
        <h2>row1</h2>
      </div>
    );
  }
}

class Opbutton extends Component{
  render(){
    return(
      <div>
        <h3>row2</h3>
      </div>
    );
  }
}


export default App;
